import { Assignment, CheckCircle, DirectionsBus, EventNote, LocalShipping, Search, SendSharp } from '@material-ui/icons';
import React from 'react';
import Widget from '../dashboard/Widget';

function Transaction(props) {
    return (
        <>
            <div className='dash'> 
                <div className='widgets'>
                    <Widget 
                        redirect='/transfer' 
                        title='TRANSFER' 
                        link='Transfer from IP'
                        color= 'white'
                        backgroundColor= '#d25f20'
                        icon={(
                                <SendSharp
                                    className="icon"
                                    fontSize='large'
                                    style={{
                                        backgroundColor: "rgba(175, 173, 173, 0.66)",
                                        color: '#fff'
                                    }}
                                />
                            )} 
                    />
                    <Widget 
                        redirect='/transport' 
                        title='TRANSPORT' 
                        link='Transport to IP'
                        icon={(
                                <DirectionsBus
                                    className="icon"
                                    fontSize='large'
                                    style={{
                                    backgroundColor: "rgba(160, 160, 160, 0.349)",
                                    }}
                                />
                            )} 
                    />
                    <Widget 
                        redirect='/availability' 
                        title='AVAILABILITY' 
                        link='Monitoring availability of products'
                        icon={(
                                <CheckCircle
                                    className="icon"
                                    fontSize='large'
                                    style={{
                                        backgroundColor: "rgba(175, 173, 173, 0.66)",
                                        color: '#fff'
                                    }}
                                />
                            )} 
                    />
                    <Widget 
                        redirect='/dispatch' 
                        title='IP DISPATCH' 
                        link='Implementing partner dispatch'
                        icon={(
                                <LocalShipping
                                    className="icon"
                                    fontSize='large'
                                    style={{
                                    backgroundColor: "rgba(160, 160, 160, 0.349)",
                                    }}
                                />
                            )} 
                    />
                </div>
                <div className='widgets'>
                    <Widget 
                        redirect='/acknowledge' 
                        title='ACKNOWLEDGE' 
                        link='Acknowledge product from warehouse'
                        backgroundColor='#20b0d2'
                        color='#fff'
                        icon={(
                                <LocalShipping
                                    className="icon"
                                    fontSize='large'
                                    style={{
                                    backgroundColor: "rgba(175, 173, 173, 0.66)",
                                    color: '#fff'
                                    }}
                                />
                            )} 
                    />
                    <Widget 
                        redirect='/trace' 
                        title='TRACE' 
                        link='Trace product by batch number'
                        icon={(
                                <Search
                                    className="icon"
                                    fontSize='large'
                                    style={{
                                    backgroundColor: "rgba(160, 160, 160, 0.349)",
                                    }}
                                />
                            )} 
                    />
                    <Widget 
                        redirect='/issues' 
                        title='ISSUES' 
                        link='Monitoring the quality of products'
                        icon={(
                                <Assignment
                                    className="icon"
                                    fontSize='large'
                                    style={{
                                    backgroundColor: "rgba(160, 160, 160, 0.349)",
                                    }}
                                />
                            )} 
                    />
                    <Widget 
                        redirect='/inventory' 
                        title='IP INVENTORY' 
                        link='Implementing partner inventory'
                        icon={(
                                <EventNote
                                    className="icon"
                                    fontSize='large'
                                    style={{
                                    backgroundColor: "rgba(160, 160, 160, 0.349)",
                                    }}
                                />
                            )} 
                    />
                </div>
            </div> 
        </>
    );
}

export default Transaction;
